const data = bjeurn

const getTicketScore = (ticket) => {
    let winnings = 0
    ticket.winningNos.forEach(winningNo => {
        if (ticket.ticketNos.includes(winningNo)) winnings++
    })

    return winnings ? 2**(winnings-1) : 0
}

const getTicketScore2 = (ticket) => {
    let winnings = 0
    ticket.winningNos.forEach(winningNo => {
        if (ticket.ticketNos.includes(winningNo)) winnings++
    })

    return winnings
}

console.log(data.reduce((sum, ticket) => sum + getTicketScore(ticket), 0))

const cardsCount = Array(data.length).fill(1)
const cardsScore = data.map(getTicketScore2)

for (let i = 0; i < data.length; i++) {
    const score = cardsScore[i]
    const cardCount = cardsCount[i]
    for (let j = i+1; j <= i+score; j++) {
        cardsCount[j] += cardCount
    }
}

